import React from "react";
import axios from "axios";
import { useParams, Link } from "react-router-dom";

const Home = () => {

    return(
        <div>
            <div className="nav">
                <span><Link to={'/home'} className={({ isActive }) => (isActive ? 'active' : 'inactive')}>Home</Link> | <Link to={'/yourgames'}>Your Games</Link> | <Link to={'/addgame'}>Add New Game</Link></span>
            </div>
        </div>
    )
}

export default Home;
